// SPDX-License-Identifier: GPL-3.0
pragma solidity ^0.8.20;

interface IStorkOracle {
    function latestAnswer(bytes32 assetId) external view returns (uint256);
    function decimals() external view returns (uint8);
}

contract TreasurySwap {
    // Stork Oracle address marked as immutable and public
    address public immutable storkOracle;
    // BTC/USD asset ID marked as immutable and public
    bytes32 public immutable BTC_ASSET_ID;
    
    // Added event for monitoring
    event PriceFetched(uint256 price, uint256 timestamp);
    
    // Constructor to initialize immutable variables
    constructor() {
        storkOracle = 0xacC0a0cF13571d30B4b8637996F5D6D774d4fd62; // Stork Oracle address
        BTC_ASSET_ID = 0x7404e3d104ea7841c3d9e6fd20adfe99b4ad586bc08d8f3bd3afef894cf184de; // BTC/USD pair
    }
    
    /**
     * @dev Fetches the decimals from the Stork Oracle
     * @return uint8 Number of decimal places used by the oracle
     */
    function decimals() public view returns (uint8) {
        try IStorkOracle(storkOracle).decimals() returns (uint8 dec) {
            return dec;
        } catch {
            revert("TreasurySwap: Failed to fetch decimals from oracle");
        }
    }
    
    /**
     * @dev Fetches the latest BTC price from Stork Oracle
     * @return uint256 The price adjusted for decimals
     */
    function getTokenValue() public view returns (uint256) {
        // Fetch raw price from oracle
        uint256 rawPrice;
        try IStorkOracle(storkOracle).latestAnswer(BTC_ASSET_ID) returns (uint256 price) {
            rawPrice = price;
        } catch {
            revert("TreasurySwap: Failed to fetch price from oracle");
        }
        
        require(rawPrice > 0, "TreasurySwap: Oracle returned invalid price");
        
        // Get oracle decimals
        uint8 oracleDecimals = decimals();
        
        // Adjust price based on decimals
        // Use safe decimal adjustment
        uint256 adjustedPrice = rawPrice / (10 ** uint256(oracleDecimals));
        
        require(adjustedPrice > 0, "TreasurySwap: Price adjustment resulted in zero");
        
        return adjustedPrice;
    }
}

